import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import  { useEffect }  from 'react';


const api = axios.create({
    baseURL: 'http://localhost:5000/api',
    timeout: 5000,
  });


function PostDetailOrg(){
  const { id } = useParams();
  const {post, changePost } = useState({});
  // const token = localStorage.getItem("loginToken");

  const getPost = async () => {
    try{
      console.log("requested");
      const response = api.get(`getpost/${id}`);
      console.log("got responce");
      console.log(response);
      changePost(response);
      console.log(response);
    }
    catch (err){
        console.log("failed to load this post");
    }
  }

  useEffect(() => {
    const fetchData = async () => {
        await getPost();
    }
    fetchData();
  }, []);

  return (
    <>
      <p>{id}</p>
      <p>{post}</p>
      <p>Treba ovde da bude sve vezano za post</p>
      <p>Nzm sto se slike ne ucitavaju u app bar-u</p>
    </>
  );
};

export default PostDetailOrg;
